// Get state from Supabase
const items = $input.all();
const summaData = $('–°—É–º–º–∞').first().json;
const sender = summaData.sender || '';
const message = summaData.message || '';

// Build state context
let stateContext = '';
if (items.length > 0 && items[0].json.state && Object.keys(items[0].json.state).length > 0) {
  const state = items[0].json.state;

  // Check state reset: if updated_at > 24h, reset
  const updatedAt = items[0].json.updated_at;
  if (updatedAt) {
    const hoursAgo = (Date.now() - new Date(updatedAt).getTime()) / 3600000;
    if (hoursAgo > 12) {
      // State expired, start fresh
      return [{ json: { sender, message: '–î–ê–ù–ù–´–ï –ö–õ–ò–ï–ù–¢–ê: –Ω–æ–≤—ã–π –¥–∏–∞–ª–æ–≥ (–ø—Ä–µ–¥—ã–¥—É—â–∏–π >12—á –Ω–∞–∑–∞–¥)\n---\n' + message } }];
    }
  }

  stateContext = '–î–ê–ù–ù–´–ï –ö–õ–ò–ï–ù–¢–ê:\n';
  for (const [key, value] of Object.entries(state)) {
    stateContext += '[' + key + ': ' + value + ']\n';
  }
}

// Flow rules ‚Äî always injected
const flowRules = `
–§–õ–û–£ –î–ò–ê–õ–û–ì–ê:
1. –ü–†–ò–í–ï–¢–°–¢–í–ò–ï ‚Üí —Å–ø—Ä–æ—Å–∏: —Å–∫–æ–ª—å–∫–æ –¥–Ω–µ–π? –¥–ª—è –≥–æ—Ä–æ–¥–∞/–¥–∞–ª—å–Ω–∏—Ö? –æ–ø—ã—Ç?
2. –í–´–Ø–°–ù–ï–ù–ò–ï ‚Üí –∫–ª–∏–µ–Ω—Ç –æ—Ç–≤–µ—Ç–∏–ª –Ω–∞ –≤–æ–ø—Ä–æ—Å—ã ‚Üí –≤—ã–∑–æ–≤–∏ Get Sheets ‚Üí –ø–æ–∫–∞–∂–∏ —Å–≤–æ–±–æ–¥–Ω—ã–µ –±–∞–π–∫–∏
3. –ü–û–î–ë–û–† ‚Üí –ø–æ–∫–∞–∑–∞–ª –±–∞–π–∫–∏, –∫–ª–∏–µ–Ω—Ç –≤—ã–±–∏—Ä–∞–µ—Ç
4. –í–´–ë–û–† ‚Üí –∫–ª–∏–µ–Ω—Ç —Å–∫–∞–∑–∞–ª "—Ö–æ—á—É —ç—Ç–æ—Ç"/"–±–µ—Ä—É" ‚Üí –ø–æ–¥—Ç–≤–µ—Ä–¥–∏ –≤—ã–±–æ—Ä, –ø–æ–ø—Ä–æ—Å–∏ —Ñ–æ—Ç–æ –ø–∞—Å–ø–æ—Ä—Ç–∞/ID
5. –ü–ê–°–ü–û–†–¢ ‚Üí –∂–¥—ë–º —Ñ–æ—Ç–æ –¥–æ–∫—É–º–µ–Ω—Ç–∞. [–î–û–ö–£–ú–ï–ù–¢]=–±—Ä–æ–Ω–∏—Ä—É–π, [–§–û–¢–û]=–ø–æ–ø—Ä–æ—Å–∏ –ø–∞—Å–ø–æ—Ä—Ç –∑–∞–Ω–æ–≤–æ. –ï—Å–ª–∏ –∫–ª–∏–µ–Ω—Ç —Ö–æ—á–µ—Ç –ø–æ–º–µ–Ω—è—Ç—å –±–∞–π–∫ –∏–ª–∏ –∑–∞–¥–∞—ë—Ç –≤–æ–ø—Ä–æ—Å—ã ‚Äî –≤–µ—Ä–Ω–∏ –Ω–∞ —ç—Ç–∞–ø –ü–û–î–ë–û–†/–í–´–Ø–°–ù–ï–ù–ò–ï
6. –ó–ê–ë–†–û–ù–ò–†–û–í–ê–ù ‚Üí –°–¢–û–ü. –ï—Å–ª–∏ –∫–ª–∏–µ–Ω—Ç –ø–∏—à–µ—Ç –ø–æ—Å–ª–µ –±—Ä–æ–Ω–∏—Ä–æ–≤–∞–Ω–∏—è ‚Äî –æ—Ç–≤–µ—á–∞–π –¢–û–õ–¨–ö–û: "–í–∞—à–∞ –±—Ä–æ–Ω—å –æ—Ñ–æ—Ä–º–ª–µ–Ω–∞ ‚úÖ –ï—Å–ª–∏ –Ω—É–∂–Ω–æ –∏–∑–º–µ–Ω–∏—Ç—å –±—Ä–æ–Ω–∏—Ä–æ–≤–∞–Ω–∏–µ ‚Äî —Å–∫–æ—Ä–æ —Å –≤–∞–º–∏ —Å–≤—è–∂–µ—Ç—Å—è –Ω–∞—à –º–µ–Ω–µ–¥–∂–µ—Ä üòä". –ù–∏–∫–∞–∫–∏—Ö –¥—Ä—É–≥–∏—Ö –æ—Ç–≤–µ—Ç–æ–≤ –ø–æ —Å—É—â–µ—Å—Ç–≤—É.

–°–¢–û–ü–°–õ–û–í–ê ‚Äî –µ—Å–ª–∏ –∫–ª–∏–µ–Ω—Ç –≥–æ–≤–æ—Ä–∏—Ç: "–æ—Ç–º–µ–Ω–∞"/"–Ω–µ –Ω–∞–¥–æ"/"–ø–µ—Ä–µ–¥—É–º–∞–ª"/"cancel"/"no thanks":
‚Üí –ù–ï –Ω–∞—Å—Ç–∞–∏–≤–∞–π, –Ω–æ –º—è–≥–∫–æ –æ—Å—Ç–∞–≤—å –¥–≤–µ—Ä—å –æ—Ç–∫—Ä—ã—Ç–æ–π
‚Üí –ü—Ä–∏–º–µ—Ä—ã: "–•–æ—Ä–æ—à–æ! –ï—Å–ª–∏ –ø–µ—Ä–µ–¥—É–º–∞–µ—Ç–µ ‚Äî –º—ã –≤—Å–µ–≥–¥–∞ –Ω–∞ —Å–≤—è–∑–∏ üòä" / "–ë–µ–∑ –ø—Ä–æ–±–ª–µ–º! –ë—É–¥–µ–º —Ä–∞–¥—ã –ø–æ–º–æ—á—å, –∫–æ–≥–¥–∞ –±—É–¥–µ—Ç–µ –≥–æ—Ç–æ–≤—ã ü§ô"
‚Üí –ü–æ—Å—Ç–∞–≤—å —ç—Ç–∞–ø: "–æ—Ç–º–µ–Ω—ë–Ω"
‚Üí –û–¥–Ω–æ –≤–µ–∂–ª–∏–≤–æ–µ —Å–æ–æ–±—â–µ–Ω–∏–µ, –ù–ï —É–≥–æ–≤–∞—Ä–∏–≤–∞–π –ø–æ–≤—Ç–æ—Ä–Ω–æ

–ü–†–ê–í–ò–õ–û: –æ–±–Ω–æ–≤–ª—è–π —ç—Ç–∞–ø –≤ STATE –ø—Ä–∏ –ö–ê–ñ–î–û–ú –ø–µ—Ä–µ—Ö–æ–¥–µ!
`;

return [{
  json: {
    sender: sender,
    message: stateContext + flowRules + '---\n–°–æ–æ–±—â–µ–Ω–∏–µ –∫–ª–∏–µ–Ω—Ç–∞: ' + message
  }
}];

// Get AI Agent response
const aiOutput = $input.first().json.output || $input.first().json.text || '';
const sender = $('–°—É–º–º–∞').first().json.sender || '';

// Extract state updates from AI response
// AI should output STATE: {...} block, but we also parse structured info
const state = {};

// Try to extract from STATE: block if AI outputs it
const stateMatch = aiOutput.match(/STATE:\s*\{([^}]+)\}/);
if (stateMatch) {
  try {
    const parsed = JSON.parse('{' + stateMatch[1] + '}');
    Object.assign(state, parsed);
  } catch(e) {}
}

// Also extract from [key: value] patterns
const kvMatches = aiOutput.matchAll(/\[([^:]+):\s*([^\]]+)\]/g);
for (const m of kvMatches) {
  state[m[1].trim()] = m[2].trim();
}

// Clean response for WhatsApp (remove STATE block)
let cleanOutput = aiOutput.replace(/STATE:\s*\{[^}]+\}\n?/g, '').trim();

return [{
  json: {
    output: cleanOutput,
    sender: sender,
    state: state,
    hasState: Object.keys(state).length > 0
  }
}];
